// Roles
import { ROLES } from '../common/constants';

// Admin

// Provider

// Member
import AccountRegister from '../views/accountRegister/Register';
import RegisterAccountVerify from '../views/accountRegister/RegisterVerify';

//  Layouts

// ContextProvider
import AccountContextProvider from './../contexts/member/AccountRegisterContext';

const accountRegisterRoute = [
	// Account Register route
	{
		path: '/dang-ky',
		title: 'Trang đăng ký',
		icon: 'design_app',
		roles: [ROLES.anonymous],
		component: AccountRegister,
		layout: ({ children }) => <>{children}</>,
		wrapContextProvider: ({ children }) => (
			<AccountContextProvider>{children}</AccountContextProvider>
		),
	},
	// Account Register Verify route
	{
		path: '/xac-nhan-dang-ky',
		title: 'Xác nhận đăng ký',
		icon: 'design_app',
		roles: [ROLES.anonymous],
		component: RegisterAccountVerify,
		layout: ({ children }) => <>{children}</>,
		wrapContextProvider: null,
	},
];

export default accountRegisterRoute;
